import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Menu, MenuItem, Dialog } from '@blueprintjs/core';

export default class MainMenu extends Component {
   state = {
      isOpen: false
   };

   handleOpen = () => this.setState({ isOpen: true });
   handleClose = () => this.setState({ isOpen: false });
   render() {
      return (
         <div>
            <Dialog onClose={this.handleClose}>app info</Dialog>
            <Menu>
               <MenuItem icon='application' text='About this app...' />
               <MenuItem
                  icon='applications'
                  text='Apps'
                  popoverProps={{ openOnTargetFocus: false }}
                  shouldDismissPopover={true}
                  onClick={() => this.handleOpen}
               >
                  <Link to='/Dashboards'>
                     <MenuItem icon='dashboard' text='Dashboard' />
                  </Link>
                  <Link to='/Projects'>
                     <MenuItem icon='projects' text='Project' />
                  </Link>
                  <Link to='/Reports'>
                     <MenuItem icon='manually-entered-data' text='Reports' />
                  </Link>
                  <Link to='/AdminPanel'>
                     <MenuItem icon='control' text='Admin' />
                  </Link>
               </MenuItem>
            </Menu>
         </div>
      );
   }
}
